import React, { Component } from 'react';
import './App.css';

// 클래스 안에 속하는 function은 function을 생략 원래 function render이나 생략
class Subject extends Component {
  render(){
    return (
      <header>
        <h1>WEB</h1>
        world wird web;
    </header>
    );
  }
}

class App extends Component{
  render() {
  return (
    <div className="App">
     Hello, React!!!
    </div>
    );
  }
}
export default App;
